import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
import logo from '../../res/23619.jpeg';
import './home.css';
import LeafsComponents from './subcomponents/LeafsComponents';
const Home = () => {
  return (
    <div style={{position: 'relative'}}>
      <img object-fit="contain" src={logo} class="sliderImage" />
      <LeafsComponents />
      <div
        style={{
          justifyContent: 'center',
          justifyItems: 'center',
          display: 'flex',
        }}
      >
        <Card style={{width: '90%', margin: 20}}>
          <Card.Header as="h5">EXPLORE CANADA</Card.Header>
          <Form
            inline
            style={{
              paddingLeft: 20,
              paddingRight: 20,
              paddingTop: 10,
              paddingBottom: 10,
            }}
          >
            <Form.Row style={{width: '100%'}}>
              <Col lg={4}>
                <Form.Control
                  type="text"
                  placeholder="SEARCH BY CITY NAME"
                  style={{width: '100%', backgroundColor: 'red'}}
                />
              </Col>
              <Col
                lg={6}
                style={{
                  width: '100%',
                  backgroundColor: 'red',
                }}
              >
                <Row
                  controlId="formGroupCheckIn"
                  style={{
                    width: '100%',
                    backgroundColor: 'red',
                  }}
                >
                  <Form.Label
                    style={{fontSize: 14, fontWeight: 'bold', width: '20%'}}
                  >
                    Check In
                  </Form.Label>
                  <Form.Control
                    type="date"
                    placeholder="Start Date"
                    style={{width: '30%'}}
                  />
                  <Form.Label
                    style={{fontSize: 14, fontWeight: 'bold', width: '20%'}}
                  >
                    Check Out
                  </Form.Label>
                  <Form.Control
                    type="date"
                    placeholder="End Date"
                    style={{width: '30%'}}
                  />
                </Row>
              </Col>
              {/* <Col lg={3}>
                <Form.Group controlId="formGroupCheckout" style={{width: 300}}>
                  <Form.Label style={{fontSize: 14, fontWeight: 'bold'}}>
                    Check Out
                  </Form.Label>
                  <Form.Control type="date" placeholder="End Date" />
                </Form.Group>
              </Col> */}
              <Col lg={2}>
                <Button style={{width: '100%', height: 35}}>Search</Button>
              </Col>
            </Form.Row>
          </Form>
        </Card>
      </div>
    </div>
  );
};
export default Home;
